import React from 'react'
import { Chart } from "react-google-charts";
import PersonalPageCss from './PersonalPage.css'


class Notes extends React.Component{
  state={
    notes: [],
  }

  componentDidMount(){
    // API.getNotes()
  }

  render(){
    return(
      <>
        <h1>Notes</h1>
        <ul>
          {this.state.notes.map(note=><li>note</li>)}
        </ul>
        </>

    )
  }


}
export default Notes
